            {
                headers,
                params: queryParams
            });
        console.log(resp.data);
    }
    catch (err) {
        console.error(err)
    }
}

function Product() {
  return (
      <div className="product-body">
        Product Page
        <div>
            <button className="button-fetch" type="button" onClick={fetchAllProduct}>get data</button>
        </div>
      </div>

  );
}

export default Product;
